import React from "react";
import styles from "./Modal.module.css";
import { RiCloseLine } from "react-icons/ri";
import CreateWorkoutsForm from "./CreateWorkoutsForm";
const Modal = ({setIsOpen}) => {
    return (
        <>
          <div className={styles.darkBG} onClick={() => setIsOpen(false)} />
          <div className={styles.centered}>
            <div className={styles.modal}>
                <div className={styles.modalHeader}>
                    <h5 className={styles.heading}>Create you own workout!</h5>
                </div>
                <button className={styles.closeBtn} onClick={() => setIsOpen(false)}>
                <RiCloseLine style={{ marginBottom: "-3px"}} />
                </button>
                <div className={styles.modalContent}>
                 <CreateWorkoutsForm>
                  
                 </CreateWorkoutsForm>
                   
                </div>
                <div className={styles.modalActions}>
      
                  <div className={styles.actionsContainer}>
                   
                    <button className={styles.cancelBtn} onClick={()=> setIsOpen(false)}>Add</button>
                    <button className={styles.deleteBtn} onClick={()=> setIsOpen(false)}>Cancel</button>
                  </div>

                </div>
            </div>
          </div>
          // ...
        </>
      );
};


export default Modal;
